import ExclusiveImg from "./assets/exclusive_image.png";
import { Link } from "react-router-dom";

export default function Exclusive() {
    return (
        <section className="exclusive px-5">
            <div className="row">
                <div className="col-md-8 d-flex flex-column justify-content-center"><h3>For your first Qshop Experience<br />Exclusive Qara Products</h3>

                    <Link to="/"></Link></div>
                <div className="col-md-4">
                    <img src={ExclusiveImg} alt="Exclusive" />
                </div>
            </div>
        </section>
    );
}
